import React, { useState } from 'react'

function FunctionMouse() {
    const[Mouseposition,setMousePosition]=useState({x:0,y:0})
    return (
        <div>
            <h1>PosX={Mouseposition.X} PosY={Mouseposition.Y}</h1>
        </div>
    )
}

export default FunctionMouse
